import React, { Component, Fragment } from 'react';
import './App.css';

class App extends Component {
  render() {
    const name = 'John Doe';
    const loading = false;

    if (loading) {
      return <h4>Loading</h4>;
    }

    return (
      <div className='App'>
        <h1>Hello {name}</h1>
        <h2>Goodbye</h2>
      </div>
    );
  }
}

export default App;
